surface._virtualQueryString:
function (source, callback) {


var generateData = function () {
  var max_val = 5;
  var step = 0.5;
  var output = [];
  for (var x = -max_val; x <= max_val; x += step) {
    for (var y = -max_val; y <= max_val; y += step) {
      output.push(
        {"x":x,
         "y": y,
         "z": Math.pow(y,2)-Math.pow(x,2),
         "v": Math.cos(y) - Math.cos(x)
         });
    }
  }
  return output;
};


   var d = {
     meta : {"x": 8, "y": 8, "z": 8, "v": 8},
     rows : generateData(),
     columns : ["x", "y", "z", "v"]
   }

    callback(d);
}

